
    <!DOCTYPE html>
    <html>
    <head>
        <meta charset="utf-8" />
        <title>Interactive Dashboard</title>
        <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no" />
        <script src="https://cdn.plot.ly/plotly-latest.min.js"></script>
        <style>
            body { font-family: sans-serif; display: flex; flex-direction: column; height: 100vh; margin: 0; }
            .controls { padding: 10px; border-bottom: 1px solid #ccc; background-color: #f8f9fa; }
            .main-container { flex-grow: 1; display: flex; }
            .scatter-container { flex: 2; min-width: 0; border-right: 1px solid #ccc; }
            .details-container { flex: 1; min-width: 0; display: flex; flex-direction: column; }
            .radar-container, .line-container { flex: 1; min-height: 0; }
            .radar-container { border-bottom: 1px solid #ccc; }
            .plotly-graph-div { width: 100%; height: 100%; }

            /* 모바일 반응형 CSS */
            @media (max-width: 768px) {
                body { height: auto; }
                .main-container {
                    flex-direction: column;
                }
                .scatter-container, .details-container {
                    flex: none;
                    width: 100%;
                    border-right: none;
                }
                .scatter-container {
                    height: 50vh;
                }
                .details-container {
                    height: 80vh;
                }
                #playerSearch {
                    font-size: 16px; /* iOS 자동 확대 방지 */
                }
            }
        </style>
    </head>
    <body>
        <div class="controls">
            <b>플레이어 검색 (최대 4명, 콤마(,)로 구분):</b>

        <div class="main-container">

            <div class="details-container">
                <div id="radar-chart" class="radar-container"></div>
                <div id="line-chart" class="line-container"></div>
            </div>
        </div>

            const playerData = JSON.parse(decode_utf8_b64(encodedPlayerData));
            const scoreProgression = JSON.parse(decode_utf8_b64(encodedScoreData));
            const radarCols = {"total_matches": "경기 수", "ap_score": "활동량", "win_rate_same_tier_val": "vs동티어 승률", "win_rate_higher_tier_val": "vs상위티어 승률", "win_rate_lower_tier_val": "vs하위티어 승률", "clutch_val": "클러치"};

            const startDate = '2025-05-24';
            const endDate = '2025-07-16';
            const xAxisTickVals = ["2025-05-24", "2025-06-03", "2025-06-14", "2025-06-24", "2025-07-05", "2025-07-16"];

            const highlightColors = ['#EF553B', '#00CC96', '#FFA15A', '#636EFA'];
            const highlightSymbols = ['star', 'circle', 'diamond', 'square'];

            const scatterDiv = document.getElementById('scatter-plot');
            const radarDiv = document.getElementById('radar-chart');
            const lineDiv = document.getElementById('line-chart');
            const searchInput = document.getElementById('playerSearch');
            const searchButton = document.getElementById('searchButton');  

            const backgroundTrace = {
                x: playerData.map(p => p.ap_score), y: playerData.map(p => p.clutch_val),
                mode: 'markers', marker: { color: '#a0a0a0', size: 8, opacity: 0.6 },
                text: playerData.map(p => p.player), hoverinfo: 'text', type: 'scatter'
            };

            const scatterLayout = {
                title: "플레이어 성향 지도",
                xaxis: { title: "활동량(노력/성실함)", zeroline: false, showticklabels: false},
                yaxis: { title: "캐리능력(재능/스타성)", zeroline: false, showticklabels: false},
                showlegend: false, hovermode: 'closest',
                shapes: [
                    { type: 'line', x0: 80.83039548022599, y0: 0, x1: 80.83039548022599, y1: 1, yref: 'paper', line: { color: 'grey', width: 1, dash: 'dash' } },
                    { type: 'line', x0: 0, y0: 1.4318852459016393, x1: 1, y1: 1.4318852459016393, xref: 'paper', line: { color: 'grey', width: 1, dash: 'dash' } }
                ],
                annotations: [
                    { x: 0.95, y: 0.95, xref: 'paper', yref: 'paper', text: '재능있는 노력가', showarrow: false, font:{color:'grey', size:14} },
                    { x: 0.05, y: 0.95, xref: 'paper', yref: 'paper', text: '재능있는 한량', showarrow: false, font:{color:'grey', size:14} },
                    { x: 0.02, y: 0.02, xref: 'paper', yref: 'paper', text: '증명이 필요한 미생', showarrow: false, font:{color:'grey', size:14} },
                    { x: 0.95, y: 0.02, xref: 'paper', yref: 'paper', text: '성실한 노력가', showarrow: false, font:{color:'grey', size:14} }
                ]
            };
            
            Plotly.newPlot(scatterDiv, [backgroundTrace], scatterLayout, { responsive: true });

            function updateCharts(selectedPlayers = []) {
                // 스캐터 플롯 업데이트
                const highlightTraces = [];
                selectedPlayers.forEach((player, i) => {
                    const pData = playerData.find(d => d.player === player);
                    if (pData) {
                        highlightTraces.push({
                            x: [pData.ap_score], y: [pData.clutch_val], mode: 'markers',
                            marker: { 
                                color: highlightColors[i % highlightColors.length], 
                                symbol: highlightSymbols[i % highlightSymbols.length],
                                size: 12, line: {width: 1.5, color: 'black'}
                            }, text: pData.player, hoverinfo: 'text', type: 'scatter', name: pData.player
                        });
                    }
                });
                Plotly.react(scatterDiv, [backgroundTrace, ...highlightTraces], scatterLayout);

                // 검색된 플레이어가 있을 때만 레이더/라인 차트를 그림
                if (selectedPlayers.length > 0) {
                    // 레이더 차트 업데이트
                    const radarData = [];
                    selectedPlayers.forEach((player, i) => {
                        const pData = playerData.find(d => d.player === player);
                        if (pData) {
                            radarData.push({
                                type: 'scatterpolar', r: Object.keys(radarCols).map(key => pData[key + '_norm']),
                                theta: Object.values(radarCols), fill: 'toself', name: player,
                                line: { color: highlightColors[i % highlightColors.length] }
                            });
                        }
                    });
                    
                    //  레이더 차트  
                    Plotly.react(radarDiv, radarData, { 
                        title: '플레이어 능력치 비교', 
                        polar: { radialaxis: { visible: false, range: [0, 100] } }, 
                        showlegend: true, 
                        legend: {
                            x: 0.5, y: -0.15, xanchor: 'center', orientation: 'h'
                        }
                    });

                    // 라인 차트 업데이트  
                    const lineData = [];
                    selectedPlayers.forEach((player, i) => {
                        if (scoreProgression[player] && scoreProgression[player].y.length > 0) {
                            lineData.push({ 
                                type: 'scatter', 
                                x: scoreProgression[player].x, 
                                y: scoreProgression[player].y, // Python이 계산한 최종 Y값을 그대로 사용
                                mode: 'lines+markers', 
                                name: player, 
                                line: { color: highlightColors[i % highlightColors.length] }, 
                                hoverinfo: 'none' 
                            });
                        }
                    });
                    let yMin = Infinity, yMax = -Infinity;
                    lineData.forEach(trace => {
                        const playerMin = Math.min(...trace.y);
                        const playerMax = Math.max(...trace.y);
                        if (playerMin < yMin) yMin = playerMin;
                        if (playerMax > yMax) yMax = playerMax;
                    });
                    let yRange = yMax - yMin;
                    if (yMin === Infinity || yMax === -Infinity) { /* No data */ }
                    else if (yRange < 20) { const mid = yMin + yRange / 2; yMin = mid - 10; yMax = mid + 10; }
                    else { const padding = yRange * 0.1; yMin -= padding; yMax += padding; }

                    const lineLayout = {
                        title: '개인별 점수 변동 추이',
                        yaxis: { title: '', showticklabels: false, showgrid: false, zeroline: false, showline: true, linecolor: 'black', linewidth: 2, range: [yMin, yMax], autorange: false },
                        xaxis: { title: '경기 일자', type: 'date', range: [new Date(new Date(startDate).getTime() - 24 * 60 * 60 * 1000).toISOString().split('T')[0], new Date(new Date(endDate).getTime() + 24 * 60 * 60 * 1000).toISOString().split('T')[0]], tickmode: 'array', tickvals: xAxisTickVals, tickformat: '%m/%d', showgrid: true, gridcolor: '#E5E5E5', showline: true, linecolor: 'black', linewidth: 2, autorange: false },
                        showlegend: true,
                    };
                    Plotly.react(lineDiv, lineData, lineLayout);

                } else {
                    Plotly.react(radarDiv, [], {title: '플레이어를 검색하면 능력치 레이더가 표시됩니다.'});
                    Plotly.react(lineDiv, [], {title: '플레이어를 검색하면 점수 추이가 표시됩니다.'});
                }
            }
            
            // 검색 로직 함수화 및 이벤트 리스너 수정 
            function performSearch() {
                const names = searchInput.value.split(',').map(name => name.trim()).filter(Boolean);
                updateCharts(names.slice(0, 4));
                searchInput.blur(); // 검색 후 입력창 포커스 해제 (키보드 내리기)
            }

            // '검색' 버튼 클릭 시 검색 실행
            searchButton.addEventListener('click', performSearch);
            
            // 입력창에서 'Enter'나 '완료' 등을 눌렀을 때도 검색 실행 (change 이벤트)
            searchInput.addEventListener('change', performSearch);
            
            // 초기 로딩 시 빈 차트 호출
            updateCharts([]);
        </script>
